import { useState } from 'react';
import './App.css';

function App() {

const [city,setcity] = useState('');

const[weatherInfo,setweatherInfo] = useState(null);
  return (
    <div className="App">
     <input 
     type = 'text'
     placeholder='Enter the city'
     value={city}
     onChange={(e)=>setcity(e.target.value)}
     />
     <button onClick={()=>setweatherInfo(city)}>Get Weather</button>
     {weatherInfo && <h1>{weatherInfo}</h1>}
    </div>
  );
}

export default App;
